import "./SubBlock.scss";
const SubBlock = () => {
  return (
    <div className="subBlock">
      <div className="headerLeft">
        <h3> {"Yenilikçi ve Kaliteli Hizmet"}</h3>
        <h1>
          {" "}
          {" Önder Hukuk ve Danışmanlık tüm hukuki sorunlarınızda yanınızda."}
        </h1>
        <p>
          {` Müvekkillerine en iyi şekilde hizmet vermek Önder Hukuk ve Danışmanlık Bürosu'nun ana prensibidir. 
          Önder Hukuk olarak müvekkillerimize ihtiyaç duydukları hukuki desteği en hızlı ve en güvenilir şekilde sağlamaktayız.`}
        </p>
      </div>
    </div>
  );
};
export default SubBlock;
